import React, { memo } from "react";

import { Audio } from "react-loader-spinner";

const AudioLoad = () => {
  return (
    <Audio
      height="35"
      width="35"
      radius="9"
      color="white"
      ariaLabel="three-dots-loading"
      wrapperStyle
      wrapperClass
    />
  );
};

export default memo(AudioLoad);
